  const popoverLeft = (
    <Popover id="popover-positioned-left" title="Popover left">
      <strong>Holy guacamole!</strong> Check this info.
    </Popover>
  );

  return (
    <OverlayTrigger trigger="click" placement="right" overlay={popoverLeft}>
      <Button>Holy guacamole!</Button>
